import React from 'react';

function Home() {
  return (
    <div className="container">
      <h1>Welcome to the Career Analysis App</h1>
      <p>
        This app helps you discover a career path that best fits your interests and strengths.
      </p>
      <p>
        Click on "Analysis" in the navigation bar to get started.
      </p>
    </div>
  );
}

export default Home;
